import React from 'react';
import classes from './leftBar.module.css';
import { Img } from '../AllPng/AllPng.tsx'
import { LeftBarSvgSelector } from '../leftBarSvgSelector.tsx';
import { Button } from '../Button/Button.tsx'
import  Menu  from './Menu/Menu.jsx'


//import logo from '../../../public/images/logo.png'

const LeftBar = () => {

	return (
		<div className={classes.leftBar}>
			<div className={classes.logo}>
				<Img id="leftBarLogo" />
			</div>



			<Menu/>

			
		      <div>
					<button><Button className={classes.button} id="button_CreateTask"/></button>
					</div>

		      <div>
					<button>
					<LeftBarSvgSelector className={classes.svg} id="profile_icon" /> 
					<Button className={classes.button} id="button_LogOut"/></button>
					</div>	
								
		   </div>
	)
}


export default LeftBar;
